import React from 'react';
import classes from './MyPosts.module.css';

const MyPosts = () => {
    return (
      <div className={classes.content}>
        <div>
          My Post
          <textarea name="" id="" cols="30" rows="10"></textarea>
          <button>A</button>
        </div>
        <div>
          New Post
        </div>
        <div>
          1 Post
        </div>
        <div>
          2 Post
        </div>
      </div>
    );
}
export default MyPosts;
